import React, { Component } from 'react';


class Form extends Component {
    
    constructor(props){
        super(props)

        this.state = {
            username: ''
        }
    }

    handleUsernameCahnge = (event) => {
        this.setState({
            username: event.target.value
        })
    }


   render(){
       return ( 
           <div>
               <label>Stellle</label>
               <input type="text" value={this.state.username} onChange={this.handleUsernameCahnge}/>
           </div>
        );

   }
   
}
 
export default Form;
